import React, { Component } from 'react';
import User from './User';





export default class App extends Component { 
  
    render() {   
        return (
            <div>
                <form >
                    
                    Name: <input type='text'/>
                   <br></br>
                  
                    Password: <input type='text' />
                   <br></br>
                   Adde: <input type='text' />
                </form>
            </div> 
        );                 
    }
}
